/*
 * LightningChartJS example showcasing PolarChart and PolarAreaSeries in a electromagnetic field strength visualization application.
 */
// Import LightningChartJS
const lcjs = require('@arction/lcjs')

// Extract required parts from LightningChartJS.
const {
    lightningChart,
    Themes,
    ColorHEX,
    SolidFill,
    SolidLine,
    emptyFill,
    UIOrigins,
    PolarAreaSeriesTypes,
    emptyLine
} = lcjs

const app = (data) => {
    // Create a polar chart.
    const polar = lightningChart().Polar({
        // theme: Themes.dark
    })
        .setTitle('Electromagnetic field strength')

    // Configure Polar Axes.
    const radialAxis = polar.getRadialAxis()

    const amplitudeAxis = polar.getAmplitudeAxis()
        .setTitle('Field strength H (A/m)')

    // Create series for each data set.
    const series = data.map(( info ) => {
        const { name, fill, stroke } = info
        const polarAreaSeries = polar.addAreaSeries()
            .setName( name )
            .setConnectDataAutomaticallyEnabled(true)
            .setMouseInteractions(false)
            .setCursorResultTableFormatter((builder, series, angleDeg, amplitude, format) => builder
                .addRow(`${series.getName()}`)
                .addRow('Angle', '', `${Math.round(angleDeg)} Â°`)
                .addRow('Field strength', '', `${format(amplitude)} A/m`)
            )

        if (fill)
            polarAreaSeries.setFillStyle(new SolidFill({ color: ColorHEX(fill) }))
        else
            polarAreaSeries.setFillStyle(emptyFill)

        if (stroke)
            polarAreaSeries.setStrokeStyle(new SolidLine({
                fillStyle: new SolidFill({ color: ColorHEX(stroke) }),
                thickness: 5
            }))
        else
            polarAreaSeries.setStrokeStyle(emptyLine)

        return polarAreaSeries
    })

    // Animate series data with random static to simulate live sensor data.
    let freezeData = false
    const updateData = () => {
        if (! freezeData)
            series.forEach((series, i) => {
                const polarPoints = data[i].data
                const polarPointsWithStatic = polarPoints.map( polarPoint => ({
                    angle: polarPoint.angle,
                    amplitude: polarPoint.amplitude + (Math.random() * 2 - 1) * 0.2
                }))
                series.setData(polarPointsWithStatic)
            })

        requestAnimationFrame(updateData)
    }
    updateData()

    // Add LegendBox.
    const legendBox = polar.addLegendBox()
    legendBox.add(polar)

    // Freeze data animation while mouse is on Chart.
    polar.onSeriesBackgroundMouseEnter(() => {
        freezeData = true
    })
    polar.onSeriesBackgroundMouseLeave(() => {
        freezeData = false
    })
    
}

